/**
 * Initialize Lazy Loading Scripts for ViDA
 * Loads in header @dependent on jQuery, Jquery Lazy plugin, vida-scripts-init
 */
jQuery(function(e){e(".lazy").show().lazy({effect:"fadeIn",threshold:150,combined:!0,delay:15e3,enableThrottle:!0,throttle:250,beforeLoad:function(e){var a=e.data("src")
console.log('image "'+a+'" is about to be loaded')},afterLoad:function(e){e.addClass("handled")
var a=e.data("src")
console.log('image "'+a+'" was loaded successfully')}})})
